// SPDX-License-Identifier: MIT

pragma solidity ^0.8.14;


contract SimpleContract {
  struct Data {
      uint a;
      uint b;
  }
  function getNum() public pure returns(uint){
      Data memory datas;
      datas.a = 1;
      datas.b = 2;
      return datas.a + datas.b;
  }
}

